import React from "react";

class Form extends React.Component {
    render() {
        return (
            <form onSubmit={this.props.weather}>
                <input type="text" name="city" placeholder="Город"></input>
                <button>Получить погоду</button>
            </form>
        )
    }
}

export default Form;
